ಶ್ರೀ ಸಂತು ಮುದ್ರಾಡಿ ಬರೆತಿನ ಪದ್ಯೊದ ಸಾಲ್‌ಗ್ ತುಳು ಅಕಾಡೆಮಿದ ಗುರ್'ಕಾರ್'ಲು ದಯಾನಂದ್ ಕತ್ತಲ್‌ಸಾರ್ ತನ್ನ ಸೊರ ಕೊರ್ದು ತುಳು ಸಾಹಿತ್ಯೊಗು ಕೊರ್ತಿನ ಮರ್ಯಾದಿ
ಸಂತೋಷೆರೆನ ಈ ಪೊರ್ಲುತ ಬರವು ಅಯಿನ ಬೋಂಟೆಗ್ ನಿಕುಲು ಮಾಂತ ಕೇಂದ್ ತುಳು ಸಾಹಿತ್ಯೊಗಾದ್ ಬೆಲೆ ಮಲ್ತಿ ಜನೊಕ್ಲೆನ ಉಮೇದ್ ಯೆರ್ಸಾಲೆ
