ಇಂಚ ಈರೆನ ಪುದರ್ಡ್ ತುಳುನಾಡ್ ಡ್ ಗೊಬ್ಬುನ  ಜನಕ್ಲೆಗ್ ಈರ್ ಕ್ರಮ ದೆತೊನ್ಲೆ.

ಕನ್ನಡ ಅಭಿವೃದ್ಧಿ ಪ್ರಾಧಿಕಾರವು ತುಳು ಭಾಷೆಯ ಕಡೆಗೂ ಗಮನ ಕೊಟ್ಟು ತುಳು ಮಾತೃಭಾಷೆಯ ಜನರಿಗೂ ಶಿಕ್ಷಣದಲ್ಲಿ ತುಳು ಕಲಿಯುವ ಅವಕಾಶ ಮಾಡಿಕೊಡುವಂತೆ ಸರಕಾರವನ್ನು ಒತ್ತಾಯಿಸಬೇಕೆ ಹೊರತು ತುಳುವನ್ನು ಶಿಕ್ಷಣದಿಂದ ದೂರ ಇಡುವ ಪ್ರಯತ್ನ ಮಾಡಬಾರದು. #EducationInTulu
